Описание:
Вашему вниманию предлагается земельный участок под строительство апарт-отеля в историческом центре города с готовым архитектурным проектом!

 Участок расположен в центре города Калининграда:
- остановка общественного транспорта: удаление 390 метров;
- продовольственные магазины: удаление от 25 метров;
- железнодорожный вокзал: пригородный 
вокзал удаление 0.5 км, дальнего следования вокзал удаление 3 км;
- автовокзал: удаление 3 км;
- аэропорт: удаление 25 км;
- город-курорт Зеленоградск: удаление 35 км
Наличие инженерных сетей и их выделенная мощность:
- электроснабжение. Выделенная мощность 150кВт + подстанция на 450кВт; - газоснабжение: да;
- водоснабжение: да (нужно уточнить данные);
- водоотведение: да;
- теплоснабжение: автономная газовая котельная;
- гидротехник (ливневая канализация): да;
- сети связи и интернет: да, оптоволоконная сеть.

На территории данного участка на текущей момент располагается гостиница Орион.

